import React from "react";
import style from "./style.module.css";
import Greating from "./greatings";

const LoginPage = () => {
    const name:string = "aaa";
return (
  
    <div>
        <h1 className={style.heading} >Login page</h1>
        <Greating name={name} />
    </div>
)

}

export default LoginPage;
